import React from 'react';
import './HomeHeader.css';

function HomeHeader() {
  return (
    <div className="home-header">
      <h1>The people platform—Where interests become friendships</h1>
      <p>Whatever your interest, from cultural events to food festivals, there are people who share it on CultuReach. Events are happening every day—sign up to join the fun.</p>
      <button className="join-button">Join CultuReach</button>
    </div>
  );
}

export default HomeHeader;
